INSERT INTO `estate_daily_temp_batdongsan_com_vn` VALUES (258, '41484893', 'Chính chủ bán 2 căn Vinhomes Smart City, căn 1 + 1 tầng, căn 2 + 1 64m2 tầng 2x sẵn sổ cất két', 'Dự án The Sakura - Vinhomes Smart City, Phường Tây Mỗ, Nam Từ Liêm, Hà Nội.', 'Không có nhu cầu ở chính chủ cần bán 2 căn hộ sẵn sổ hồng cất két giao dịch luôn trong tuần LH chị Trang 0911 825 ***- Căn 2 + 1 tầng trung view phố, nhà mới nguyên đã làm tủ bếp.- Diện tích 64m² cửa vào Tây Nam, BC Đông Bắc - Tây Bắc hợp với người Tây Tứ', '64 m²', '3,18 tỷ', '\r', '', '', '2 phòng', 'Sẵn sổ cất két.', '[\'https://file4.batdongsan.com.vn/resize/200x200/2024/11/10/20241110122325-ce6f_wm.jpg\', \'https://file4.batdongsan.com.vn/resize/200x200/2024/11/10/20241110122341-8571_wm.jpg\', \'https://file4.batdongsan.com.vn/resize/200x200/2024/11/10/20241110122401-3c02', 'cuchv.94@gmail.com', 'Minh Trang Vinhomes', '10/11/2024', '17/11/2024', '14/11/2024', 'https://batdongsan.com.vn/ban-can-ho-chung-cu-phuong-tay-mo-prj-the-sakura-vinhomes-smart-city/chinh-chu-ban-2-1-1-tang-2-1-64m2-tang-2x-san-so-cat-ket-pr41484893');
