DROP FUNCTION IF EXISTS `get_ward_from_address`;
delimiter ;;
CREATE FUNCTION `get_ward_from_address`(input_string TEXT)
 RETURNS text CHARSET utf8mb4
  DETERMINISTIC
BEGIN
    return TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(input_string, ',', -3), ',', 1));
END
;;
