-- Thêm vào bảng temp_date
    SELECT temp.sk,
           MAX(CASE WHEN dd.full_date = STR_TO_DATE(temp.create_at, '%d/%m/%Y') THEN dd.sk END) AS create_at
    FROM estate_staging.estate_daily_temp_muaban_net temp
             JOIN
         estate_staging.dim_date dd
         ON STR_TO_DATE(dd.full_date, '%Y-%m-%d')
             IN (STR_TO_DATE(temp.create_at, '%d/%m/%Y'))
    GROUP BY temp.sk;

-- ------------------------------ADDRESS ---------------------
    DROP TEMPORARY TABLE IF EXISTS estate_staging.temp_address;
    CREATE TEMPORARY TABLE estate_staging.temp_address
    (
        sk      BIGINT PRIMARY KEY,
        ward_id VARCHAR(20),
        detail  VARCHAR(255)
    );
    SELECT temp.sk,
           w.sk,
           get_detail_from_address(temp.address) AS short_address
    FROM estate_staging.estate_daily_temp_muaban_net temp
             JOIN estate_staging.dim_wards w ON
        w.full_name = get_ward_from_address(temp.address) OR
        w.name = get_ward_from_address(temp.address)
             JOIN estate_staging.dim_districts d ON
        d.full_name = get_distric_from_address(temp.address) OR
        d.name = get_distric_from_address(temp.address)
             JOIN estate_staging.dim_provinces p ON
        p.full_name = get_province_from_address(temp.address) OR
        p.name = get_province_from_address(temp.address)
    WHERE w.district_sk = d.sk
      AND d.province_sk = p.sk;

-- ------------------------------ESTATE ---------------------
     nk,
     subject,
     ward_sk,
     address_detail,
     price,
     area,
     description,
     floors,
     orientation,
     bedroom,
     bathroom,
     legal,
     url,
     seller_name,
     seller_phone,
     create_at)
    SELECT edt.sk                                                                    AS sk,
           edt.nk                                                                    AS nk,
           edt.subject                                                               AS subject,
           ta.ward_id                                                                AS ward_sk,
           ta.detail                                                                 AS address_detail,
           JSON_EXTRACT(transform_price(edt.area, edt.price), '$.price_total_in_ty') AS price,
           JSON_EXTRACT(transform_price(edt.area, edt.price), '$.area_transform')    AS area,
           edt.description                                                           as description,
           transform_room(edt.floors)                                                as floors,
           edt.orientation                                                           as orientation,
           transform_room(edt.bedroom)                                               as bedroom,
           transform_room(edt.bathroom)                                              as bathroom,
           edt.legal                                                                 as legal,
           edt.url                                                                   as url,
           edt.full_name                                                             as seller_name,
           edt.phone                                                                 as seller_phone,
           td.create_at                                                              as create_at
    FROM estate_staging.estate_daily_temp_muaban_net edt
             JOIN estate_staging.temp_date td
                  ON edt.sk = td.sk
             JOIN estate_staging.temp_address ta ON edt.sk = ta.sk;
    COMMIT;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for transform_price
-- ----------------------------
DROP FUNCTION IF EXISTS `transform_price`;
delimiter ;;
CREATE FUNCTION `transform_price`(area VARCHAR(255),
    price VARCHAR(255))
 RETURNS json
  DETERMINISTIC
BEGIN
    DECLARE area_transform DECIMAL(15, 2);
    DECLARE price_total DECIMAL(20, 3);
    DECLARE billion_value DECIMAL(20, 2);
    DECLARE million_value DECIMAL(20, 2);

    -- Convert area to decimal, check if area is NULL or empty
    IF area IS NULL OR TRIM(area) = '' THEN
        RETURN JSON_OBJECT('price_total', NULL, 'area_transform', NULL);
    END IF;

    SET area_transform = CAST(REPLACE(SUBSTRING(area, 1, LOCATE(' ', area) - 1), ',', '.') AS DECIMAL(15, 2));

    -- Calculate price_total based on price format
    IF price LIKE 'Thỏa thuận' THEN
        SET price_total = NULL;

    ELSEIF price LIKE '%/%' THEN
        -- Price per square meter (e.g., "60 triệu/m²")
        SET price_total = ROUND(CAST(REPLACE(SUBSTRING(price, 1, LOCATE(' ', price) - 1), ',', '.') AS DECIMAL(15, 2)) *
                                area_transform / 1000, 3);

    ELSEIF price LIKE '%tỷ%' AND price LIKE '%triệu%' THEN
        -- Handle cases like "1 tỷ 200 triệu"
        SET billion_value = CAST(REPLACE(SUBSTRING(price, 1, LOCATE(' tỷ', price) - 1), ',', '.') AS DECIMAL(20, 2));
        SET million_value = CAST(REPLACE(
                SUBSTRING(price, LOCATE(' tỷ', price) + 4, LOCATE(' triệu', price) - LOCATE(' tỷ', price) - 4), ',',
                '.') AS DECIMAL(20, 2)) / 1000;
        SET price_total = ROUND(billion_value + million_value, 3);

    ELSEIF price LIKE '%tỷ' THEN
        -- Handle cases like "1 tỷ"
        SET price_total =
                ROUND(CAST(REPLACE(SUBSTRING(price, 1, LOCATE(' ', price) - 1), ',', '.') AS DECIMAL(20, 2)), 3);

    ELSEIF price LIKE '%triệu' THEN
        -- Handle cases like "200 triệu"
        SET price_total =
                ROUND(CAST(REPLACE(SUBSTRING(price, 1, LOCATE(' ', price) - 1), ',', '.') AS DECIMAL(20, 2)) / 1000, 3);

    ELSE
        -- Default to direct decimal conversion
        SET price_total = ROUND(CAST(REPLACE(price, ',', '.') AS DECIMAL(20, 2)) / 1000000000, 3);
    END IF;

    -- Return only price_total_in_ty and area_transform
    RETURN JSON_OBJECT(
            'price_total_in_ty', IFNULL(price_total, NULL),
            'area_transform', IFNULL(area_transform, NULL)
           );
END
;;
delimiter ;

-- ----------------------------
-- Function structure for transform_room
-- ----------------------------
DROP FUNCTION IF EXISTS `transform_room`;
delimiter ;;
CREATE FUNCTION `transform_room`(value varchar(255))
 RETURNS int
  DETERMINISTIC
BEGIN
     DECLARE room INT;
    DECLARE first_space INT;

    -- Initialize the result
    SET room = 0;

    -- Check for NULL or empty input
    IF value IS NULL OR value = '' THEN
        RETURN room;
    END IF;

    -- Find the position of the first space
    SET first_space = LOCATE(' ', value);

    -- If a space is found, process the substring
    IF first_space > 0 THEN
        SET room = CAST(REPLACE(SUBSTRING(value, 1, first_space - 1), ',', '.') AS UNSIGNED);
    ELSE
        -- No space found; cast the entire string
        SET room = CAST(REPLACE(value, ',', '.') AS UNSIGNED);
    END IF;

    RETURN room;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
